import React from 'react';
import { GoogleMap } from '@react-google-maps/api';

function Map() {
  return (
    <GoogleMap defaultZoom={10} defaultCenter={{lat: 53.551086, lng: 9.993682 }}>
      <Marker position={{ lat: -34.397, lng: 150.644 }}/>
    </GoogleMap>
  )
}

export default Map
